import React, { Fragment, useState, useCallback } from "react";
import PropTypes from "prop-types";

const type_opcen = props => {
  return (
    <Fragment>
      <div
        style={{
          display: "flex",
          flexDirection: "row",
          width: "100%",
          justifyContent: "space-around",
          padding: "20px",
          background: "#fff",
          borderRadius: "10px",
        }}
      >
        <div
          style={{
            height: "500px",
            width: "200px",
            textAlign: "center",
            margin: "auto",
          }}
        >
          <i className='fa fa-thumbs-o-up' aria-hidden='true'></i>
          <p> Government (LGU)</p>
        </div>
        <div
          style={{
            height: "500px",
            width: "200px",
            textAlign: "center",
            margin: "auto",
          }}
        >
          <i className='fa fa-thumbs-o-up' aria-hidden='true'></i>
          <p> Volunteer</p>
        </div>
        <div
          style={{
            height: "500px",
            width: "200px",
            textAlign: "center",
            margin: "auto",
          }}
        >
          <i className='fa fa-thumbs-o-up' aria-hidden='true'></i>
          <i aria-hidden='true'></i>
          <p> Private</p>
        </div>
      </div>
    </Fragment>
  );
};

type_opcen.propTypes = {};

export default type_opcen;
